## Step 1: Identify the polynomial expression
The polynomial expression is given by $p(x) = \frac{(x - b)(x - c)}{(a - b)(a - c)} + \frac{(x - a)(x - c)}{(b - a)(b - c)} + \frac{(x - a)(x - b)}{(c - a)(c - b)}$.

## Step 2: Simplify the expression by putting the terms over a common denominator
The common denominator is $(a - b)(a - c)(b - a)(b - c)(c - a)(c - b)$, which simplifies to $(a - b)(b - c)(c - a)$.

## Step 3: Write the polynomial with the terms over the common denominator
\[p(x) = \frac{(x - b)(x - c)((b - c)(c - a)) + (x - a)(x - c)((c - a)(a - b)) + (x - a)(x - b)((a - b)(b - c))}{(a - b)(b - c)(c - a)}\]

## Step 4: Expand the numerator and simplify
After expanding the numerator and simplifying, we get
\begin{align*}
p(x) &= \frac{(x^2 - (b + c)x + bc)((b - c)(c - a)) + (x^2 - (a + c)x + ac)((c - a)(a - b)) + (x^2 - (a + b)x + ab)((a - b)(b - c))}{(a - b)(b - c)(c - a)}
\end{align*}

## Step 5: Further simplify the expression for easier handling
By simplifying the expression further, we get 
\begin{align*}
p(x) &= \frac{(b - c)(c - a)(x^2 - (b + c)x + bc) + (c - a)(a - b)(x^2 - (a + c)x + ac) + (a - b)(b - c)(x^2 - (a + b)x + ab)}{(a - b)(b - c)(c - a)}
\end{align*}

## Step 6: Distribute the terms outside the parentheses
Distributing the terms outside the parentheses, we get 
\begin{align*}
p(x) &= \frac{(b - c)(c - a)x^2 - (b - c)(c - a)((b + c)x) + (b - c)(c - a)bc + (c - a)(a - b)x^2 - (c - a)(a - b)((a + c)x) + (c - a)(a - b)ac + (a - b)(b - c)x^2 - (a - b)(b - c)((a + b)x) + (a - b)(b - c)ab}{(a - b)(b - c)(c - a)}
\end{align*}

## Step 7: Combine like terms in the numerator
Combining like terms in the numerator gives us
\begin{align*}
p(x) &= \frac{((b - c)(c - a) + (c - a)(a - b) + (a - b)(b - c))x^2 - (((b - c)(c - a)(b + c) + (c - a)(a - b)(a + c) + (a - b)(b - c)(a + b))x + ((b - c)(c - a)bc + (c - a)(a - b)ac + (a - b)(b - c)ab)}{(a - b)(b - c)(c - a)}
\end{align*}

## Step 8: Simplify the coefficient of x^2 in the numerator
Since $a$, $b$, and $c$ are distinct real numbers, the expression $(b - c)(c - a) + (c - a)(a - b) + (a - b)(b - c)$ simplifies to $0$.

## Step 9: Simplify the numerator after removing the x^2 term
After removing the $x^2$ term, we get
\begin{align*}
p(x) &= \frac{- ((b - c)(c - a)(b + c) + (c - a)(a - b)(a + c) + (a - b)(b - c)(a + b))x + ((b - c)(c - a)bc + (c - a)(a - b)ac + (a - b)(b - c)ab)}{(a - b)(b - c)(c - a)}
\end{align*}

## Step 10: Simplify the coefficient of x in the numerator
After expanding and combining the terms in the numerator, the coefficient of $x$ in the numerator simplifies to $0$.

## Step 11: Simplify the numerator
After removing the $x$ term, we get
\begin{align*}
p(x) &= \frac{(b - c)(c - a)bc + (c - a)(a - b)ac + (a - b)(b - c)ab}{(a - b)(b - c)(c - a)}
\end{align*}

## Step 12: Factor the numerator
Factoring the numerator, we get
\begin{align*}
p(x) &= \frac{((b - c)(c - a) + (c - a)(a - b) + (a - b)(b - c))abc}{(a - b)(b - c)(c - a)}
\end{align*}

## Step 13: Simplify the fraction
Using the result from Step 8 that $(b - c)(c - a) + (c - a)(a - b) + (a - b)(b - c)$ simplifies to $0$, the numerator simplifies to $0$.

## Step 14: Determine the degree of the polynomial
Since the numerator simplifies to $0$, the polynomial $p(x)$ is equivalent to $0$, and the degree of $p(x)$ is $\boxed{0}$.

